import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
    container: {
       flex: 1,
       justifyContent: 'center',
    },
    itemContainer: {
       alignItems: 'center',
       backgroundColor: '#DDDDDD',
       justifyContent: 'center',
       height: 100,
       width: 100,
       margin: 5,
    },
    itemText: {
       color: '#222222',
       fontSize: 16,
    },
   });
